from sympy import divisors
def a(n):
    for l in range(1, 3*n):
        divs = divisors(l)
        if len(divs) < 3:
            continue
        for i in range(len(divs)):
            for j in range(i+1, len(divs)):
                for m in range(j+1, len(divs)):
                    if divs[i] + divs[j] + divs[m] == n:
                        return l
    return None
